import DashboardLayout from "@/layout/dashboard/DashboardLayout.vue";
import VisitorDetailLayout from "@/layout/dashboard/VisitorDetailLayout.vue";

// GeneralViews
import NotFound from "@/pages/NotFoundPage.vue";

// Admin pages
import Dashboard from "@/pages/Dashboard.vue";
import UserProfile from "@/pages/UserProfile.vue";
import VisitorResults from "@/pages/VisitorResults.vue";
import VisitorDetails from "@/pages/VisitorDetails.vue";
import EditVisitorProfile from "@/pages/EditVisitorProfile.vue";
import AddVisitorProfile from "@/pages/AddVisitorProfile.vue";
import ResolutionDesk from "@/pages/ResolutionDesk.vue";
import GenerateToken from "@/pages/GenerateToken.vue";

const routes = [
  {
    path: "/",
    component: DashboardLayout,
    redirect: "/registrationDesk",
    children: [
      {
        path: "registrationDesk",
        name: "Registration Desk",
        component: UserProfile
      },
      {
        path: "searchResults",
        name: "Search Results",
        component: VisitorResults
      },
      {
        path: "userProfile",
        name: "Edit Visitor Profile",
        component: EditVisitorProfile
      },
      {
        path: "addVisitor",
        name: "Add Visitor",
        component: AddVisitorProfile
      },
      {
        path: "resolutionDesk",
        name: "Resolution Desk",
        component: ResolutionDesk
      },
      {
        path: "dashboard",
        name: "Dashboard",
        component: Dashboard
      },
      {
        path: "generateToken",
        name: "Generate Token",
        component: GenerateToken
      }
    ]
  },
  {
  path: "/",
  component: VisitorDetailLayout,
  children: [
    {
      path: "visitorDetails",
      name: "Visitor Details",
      component: VisitorDetails
    }
  ]
},
  { path: "*", component: NotFound }
];

/**
 * Asynchronously load view (Webpack Lazy loading compatible)
 * The specified component must be inside the Views folder
 * @param  {string} name  the filename (basename) of the view to load.
function view(name) {
   var res= require('../components/Dashboard/Views/' + name + '.vue');
   return res;
};**/

export default routes;
